import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./components/home/Home";
import About from "./components/about/About";
import Projects from "./components/projects/Projects";
import Services from "./components/services/Services";
import Plans from "./components/plans_and_pricing/Plans";
import Contact from "./components/contact/Contact";
import Signup from "./components/signup/SignUp";
import Login from "./components/login/Login";
import Header from "./components/header/Header";
import Footer from "./components/footer/Footer";
import BookNow from "./components/services/BookNow";
import BookNowNext from "./components/services/BookNowNext";
import PayNow from "./components/services/PayNow";
import { FillForm } from "./components/services/FillForm";
import { SelectPlan } from "./components/plans_and_pricing/SelectPlan";

const App = () => {
  return (
    <BrowserRouter>
    <Header/>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/projects" element={<Projects />} />
        <Route path="/services" element={<Services />} />
        <Route path="/plans-and-pricing" element={<Plans />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/services/book-now" element={<BookNow />} />
        <Route path="/services/book-now-next" element={<BookNowNext />} />
        <Route path="/services/book-now-next/fill-form" element={<FillForm />} />
        <Route path="/services/book-now-next/fill-form/pay-now" element={<PayNow />} />
        {/* <Route path="/plans-and-pricing/select-plan" element={<SelectPlan />} /> */}
      </Routes>
      <Footer/>
      <Routes>
      <Route path="/sign-up" element={<Signup />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
